import {useState} from 'react'

const Rufus = props => {
	let {players} = props

	let [position, setPosition] = useState({x:20, y: 20})

	return	<circle
			cx={position.x}
			cy={position.y}
			r='5'
			fill={'red'}
		/>

}

const Gunter = props => {
	let {players} = props

	let [position, setPosition] = useState({x:36, y: 36})

	return	<circle
			cx={position.x}
			cy={position.y}
			r='5'
			fill={'blue'}
		/>

}

export {
	Rufus,
	Gunter
}
